  $searchbar.on('input', function() {
    var search = fuse.search($searchbar.val());
    var $res = $('#results');
    $res.empty();
    if ($searchbar.val().length < 1) return;
    if (search[0] === undefined) {
      $res.append('<h4 class="rip">Tidak ditemukan</h4><h6>Penelusuran anda tidak ada di Perpustakaan</h6><p>Saran: Pastikan semua kata dieja dengan benar, coba kata kunci yang lain, atau coba kata kunci yang lebih umum. Juga periksa pembaruan aplikasi untuk memastikan database buku telah diperbarui, atau hubungi pustakawann untuk melakukan reservasi.</p><p></p>');
    }
    $res.append('<h4>Apakah maksud anda: ' + search[0].name + '?</h4>');
    $res.append('<br><h5>Hasil pencarian:</h5>');

    search.forEach(function(el){
      $res.append(
        el.cat + '<br>' + el.name + '<br>' + el.bit + '<br>' + el.typing + '<br><br>'
      );
    });
  });

